import styled from "styled-components";

export const Container = styled.div`
  font-family: "Open Sans";
  display: flex;
  width: 100%;
  height: 80%;
  align-items: center;
  color: white;
  justify-content: space-around;
  background: #3e4c5e;
  :hover {
    transition-property: background-color;
    background: #3e4c5e;
  }
`;
